import React from 'react'

function Shop() {

    let items = []

    fetch('api/goods/')
        .then(response => response.json())
        .then(shop_json => {
            items = shop_json
            console.log(items) 
        })
    return (
        <div>
            {items.content.body.map(block => block.component)}
        </div>
    )
}

export default Shop
